core/maven/index.html.content:
Nasdanika Maven module uses Maven Resolver Supplier to provide capabilities for Dependency and ClassLoader requirements. Sources Javadoc Dependency CapabilityLoader capabilityLoader = new CapabilityLoader();
DependencyRequestRecord requirement = new DependencyRequestRecord(
		new String[] { &quot;org.apache.groovy:groovy-all:pom:4.0.23&quot; }, 
		null, 
		null, 
		&quot;target/test-repo&quot;);

ProgressMonitor progressMonitor = new PrintStreamProgressMonitor();
Collection&lt;File&gt; result = capabilityLoader.loadOne(requirement, progressMonitor);
 The above code snippet loads org.apache.groovy:groovy-all:pom:4.0.23 and its dependencies into target/test-repo directory and returns a list of jar files. ClassLoader CapabilityLoader capabilityLoader = new CapabilityLoader();
ClassLoaderRequirement requirement = new ClassLoaderRequirement(
		null, // String[] modulePath,
		null, // String[] rootModules,
		new ModuleLayer[] { getClass().getModule().getLayer() }, 
		getClass().getClassLoader(), // ClassLoader parentClassLoader,
		true, // boolean singleLayerClassLoader,				
		new String[] { &quot;org.apache.groovy:groovy-all:pom:4.0.23&quot; }, 
		null, 
		null, 
		&quot;target/test-repo&quot;,
		System.out::println);

ProgressMonitor progressMonitor = new PrintStreamProgressMonitor();
ClassLoader result = capabilityLoader.loadOne(
		ServiceCapabilityFactory.createRequirement(ClassLoader.class, null, requirement),
		progressMonitor);

Class&lt;?&gt; scriptEngineFactoryClass = result.loadClass(&quot;org.codehaus.groovy.jsr223.GroovyScriptEngineFactory&quot;);
 The above code snippet: Loads org.apache.groovy:groovy-all:pom:4.0.23 and its dependencies into target/test-repo directory Creates a ClassLoader Loads org.codehaus.groovy.jsr223.GroovyScriptEngineFactory class Default configuration DependencyCapabilityFactory, which is responsible for resolving and downloading dependencies, loads default configuration in the following way: If org.nasdanika.maven.DependencyCapabilityFactory.config.yml system property is set, then it is treated as a URL of a configuration YAML resource. The URL is resolved relative to the current directory. If org.nasdanika.maven.DependencyCapabilityFactory.config.json system property is set, then it is treated as a URL of a configuration JSON resource. The URL is resolved relative to the current directory. If NSD_DEPENDENCY_RESOLVER_CONFIG_YAML_URL environment variable is set, then it is treated as an absolute URL of a configuration YAML resource. If NSD_DEPENDENCY_RESOLVER_CONFIG_JSON_URL environment variable is set, then it is treated as an absolute URL of a configuration JSON resource. If NSD_DEPENDENCY_RESOLVER_CONFIG_YAML environment variable is set, then it is treated as YAML configuration. If NSD_DEPENDENCY_RESOLVER_CONFIG_JSON environment variable is set, then it is treated as JSON configuration. If dependency-reolver-config.yml file exists in the current directory the it is loaded as YAML. If dependency-reolver-config.json file exists in the current directory the it is loaded as JSON. The loaded configuration is interpolated with system properties and environment variables. E.g. ${my-property} will be expanded to the value of my-property system property if it is set. Respectively, ${env.MY_ENV_VAR} will be expanded to the value of MY_ENV_VAR environment variable if it is set. Property expansion can be escaped with additional {} e.g. ${my-property} will be expanded to ${my-property} regardless of whether my-properety system property is set or not. Configuration specification modulePath - optional String or List, module path. If null, derived from root modules if they are present rootModules - optional String or List, root modules. The first root module is used to obtain the class loader oneLayerClassLoader - optional boolean indicating whether a single class loader shall be used for all modules in in the layer dependencies - optional String or List of dependencies in &lt;groupId&gt;:&lt;artifactId&gt;[:&lt;extension&gt;[:&lt;classifier&gt;]]:&lt;version&gt;} format. E.g. org.apache.groovy:groovy-all:pom:4.0.23 managedDependencies - optional String or List of dependencies in &lt;groupId&gt;:&lt;artifactId&gt;[:&lt;extension&gt;[:&lt;classifier&gt;]]:&lt;version&gt;} format remoteRepositories - Map (single remote repository) or List of Maps of remote repository definitions loaded into RemoteRepoRecord: id - String, repo ID type - String, optional repo type url - String, repository URL proxy - optional Map: type - String, http or https host - String port - integer auth - authentication (see below) auth - Map: username - String password - String mirroredRepositories - Map or List, mirrored repositories localRepository - optional String, path to the local repository to download dependencies to. Defaults to repository. URI Handler Maven URIHandler handles URIs of the following format: maven://&lt;groupId&gt;/&lt;artifactId&gt;/&lt;extension&gt;/&lt;version&gt;/&lt;resource path&gt;[?classifier=&lt;classifier&gt;]. For example, for maven://org.nasdanika.models.architecture/model/jar/2024.8.0/model/architecture.ecore?classifier=model URI model/architecture.ecore resource would be loaded from model-2024.8.0-model.jar in org.nasdanika.models.architecture group model artifact version 2024.8.0 as shown in the snippet below: CapabilityLoader capabilityLoader = new CapabilityLoader();
ProgressMonitor progressMonitor = new PrintStreamProgressMonitor();
Requirement&lt;ResourceSetRequirement, ResourceSet&gt; requirement = ServiceCapabilityFactory.createRequirement(ResourceSet.class);		
ResourceSet resourceSet = capabilityLoader.loadOne(requirement, progressMonitor);
URI modeURI = URI.createURI(&quot;maven://org.nasdanika.models.architecture/model/jar/2024.8.0/model/architecture.ecore?classifier=model&quot;);
Resource resource = resourceSet.getResource(modeURI, true);
System.out.println(resource.getContents());

ai/ollama/index.html.content:
This module provides implementations of core capabilities backed by Ollama over REST API with integrated telemetry. However, it doesn&rsquo;t register capability factories - it has to be done in (CLI) assemblies. Sources JavaDoc Below are examples of how to register capabilities1. Embeddings Capability factory 
import java.util.concurrent.CompletionStage;

import org.nasdanika.ai.Embeddings;
import org.nasdanika.ai.ollama.OllamaEmbeddings;
import org.nasdanika.capability.CapabilityProvider;
import org.nasdanika.capability.ServiceCapabilityFactory;
import org.nasdanika.common.ProgressMonitor;
import org.nasdanika.common.Util;

import io.opentelemetry.api.OpenTelemetry;

public class SnowflakeArcticEmbedOllamatCapabilityFactory extends ServiceCapabilityFactory&lt;Embeddings.Requirement, Embeddings&gt; {

    private static final String MODEL = &quot;snowflake-arctic-embed&quot;;
    private static final String PROVIDER = &quot;Ollama&quot;;

    @Override
    public boolean isFor(Class&lt;?&gt; type, Object requirement) {
        if (Embeddings.class == type) {
            if (requirement == null) {
                return true;
            }
            if (requirement instanceof Embeddings.Requirement) {            
                Embeddings.Requirement eReq = (Embeddings.Requirement) requirement;
                if (!Util.isBlank(eReq.provider()) &amp;&amp; !PROVIDER.equals(eReq.provider())) {
                    return false;
                }
                return Util.isBlank(eReq.model()) || MODEL.equals(eReq.model());
            }
        }
        return false;
    }

    @Override
    protected CompletionStage&lt;Iterable&lt;CapabilityProvider&lt;Embeddings&gt;&gt;&gt; createService(
            Class&lt;Embeddings&gt; serviceType,
            Embeddings.Requirement serviceRequirement, 
            Loader loader, 
            ProgressMonitor progressMonitor) {

        Requirement&lt;Object, OpenTelemetry&gt; openTelemetryRequirement = ServiceCapabilityFactory.createRequirement(OpenTelemetry.class);
        CompletionStage&lt;OpenTelemetry&gt; openTelemetryCS = loader.loadOne(openTelemetryRequirement, progressMonitor);

        int chunkSize = serviceRequirement == null ? 0 : serviceRequirement.chunkSize();
        int overlap = serviceRequirement == null ? 0 : serviceRequirement.overlap();

        return wrapCompletionStage(openTelemetryCS.thenApply(openTelemetry -&gt; createEmbeddings(openTelemetry, chunkSize, overlap)));
    }

    protected Embeddings createEmbeddings(
            OpenTelemetry openTelemetry,
            int chunkSize,
            int overlap) {
        return new OllamaEmbeddings(
                &quot;http://localhost:11434/api/&quot;, 
                PROVIDER, 
                MODEL, 
                null, 
                1024,
                null, // unknown
                8192, 
                chunkSize,
                overlap,
                openTelemetry);
    }   

}
 module-info.java module &lt;module name&gt; {

    ...

    provides CapabilityFactory with SnowflakeArcticEmbedOllamatCapabilityFactory;

}
 Chat Capability factory import java.util.concurrent.CompletionStage;

import org.nasdanika.ai.Chat;
import org.nasdanika.ai.ollama.OllamaChat;
import org.nasdanika.capability.CapabilityProvider;
import org.nasdanika.capability.ServiceCapabilityFactory;
import org.nasdanika.common.ProgressMonitor;
import org.nasdanika.common.Util;

import io.opentelemetry.api.OpenTelemetry;

public class Llama32OllamaChatCapabilityFactory extends ServiceCapabilityFactory&lt;Chat.Requirement, Chat&gt; {

    private static final String MODEL = &quot;llama3.2&quot;;
    private static final String PROVIDER = &quot;Ollama&quot;;

    @Override
    public boolean isFor(Class&lt;?&gt; type, Object requirement) {
        if (Chat.class == type) {
            if (requirement == null) {
                return true;
            }
            if (requirement instanceof Chat.Requirement) {          
                Chat.Requirement cReq = (Chat.Requirement) requirement;
                if (!Util.isBlank(cReq.provider()) &amp;&amp; !PROVIDER.equals(cReq.provider())) {
                    return false;
                }
                return Util.isBlank(cReq.model()) || MODEL.equals(cReq.model());
            }
        }
        return false;
    }

    @Override
    protected CompletionStage&lt;Iterable&lt;CapabilityProvider&lt;Chat&gt;&gt;&gt; createService(
            Class&lt;Chat&gt; serviceType,
            Chat.Requirement serviceRequirement, 
            Loader loader, 
            ProgressMonitor progressMonitor) {

        Requirement&lt;Object, OpenTelemetry&gt; openTelemetryRequirement = ServiceCapabilityFactory.createRequirement(OpenTelemetry.class);
        CompletionStage&lt;OpenTelemetry&gt; openTelemetryCS = loader.loadOne(openTelemetryRequirement, progressMonitor);

        return wrapCompletionStage(openTelemetryCS.thenApply(this::createChat));
    }

    protected Chat createChat(OpenTelemetry openTelemetry) {
        return new OllamaChat(
                &quot;http://localhost:11434/api/&quot;, 
                PROVIDER, 
                MODEL, 
                null, 
                128000, 
                2048, 
                openTelemetry);
    }   

}
