nsd-cli/index.html.content:
Nasdanika Command Line Interface (CLI) is a suite of Nasdanika capabilities packaged as command line tools. Sources Prerequisites To run Nasdanika CLI you&rsquo;d need Java 17+. To build from sources you&rsquo;d also need Maven. Installation Download installation archive from the releases page. On Linux make nsd executable: chmod a+x nsd. Building from sources Download sources as a zip file or clone the repository Run mvn clean verify After the build completes the distribuion will be available in target/dist directory Adding to PATH The distribution is portable and local - it can be put to any directory, but it can only be executed from that directory. To create an installation which can be used from any directory you will need to create launcher files with absolute paths. Windows nsd.bat launcher -f options-global -o nsd-global.bat -s -m org.nasdanika.launcher -c org.nasdanika.launcher.Launcher --add-modules ALL-SYSTEM -M modules -j &quot;@java&quot;
 If you are using telemetry, add telemetry options after @java Add the installation to the PATH environment variable. You may delete/rename nsd.bat and rename nsd-global.bat to nsd.bat. Linux ./nsd launcher -o nsd-global -s -m org.nasdanika.launcher -c org.nasdanika.launcher.Launcher -M modules
 Open nsd-global in a text editor and add #!/bin/bash line before the java command line. Make the file executable and add the installation directory to the path. You may remove/rename nsd and rename nsd-global to nsd. If you get java.lang.module.FindException: Module &lt;module name&gt; not found error, open the file in a text editor, locate the problematic module and remove it from the --add-modules list.

core/mapping/index.html.content:
(Semantic) mapping is a process of creating and populating Ecore models from other data sources, Drawio diagrams in particular. This module provides base mapping functionality and the Drawio module provides concrete implementation classes and several Drawio-specific comparators which use element properties and geometry. This page provides a combined documentation for both generic and Drawio-specific mapping. Resources: Semantic Mapping Medium Story provides a high-level overview focusing more on the WHAT and the WHY while this page focuses more on the HOW. Most code snippets below are taken from the semantic mapping demo. EMF Ecore ContentProvider DrawioContentProvider Loading Drawio resources Phases &amp; properties Initialization initializer Groovy initializer Mapping Script Java intitializer Mapping Initializer method type ref-id Contributor.initialize() page-element prototype selector target-selector reference features end container Example contents Examples USA Joe self source start target features-ref Representations Filtering Configuration config-prototype Documentation Label Markers identity configuration Tooltip Contributor.configure() Operations arguments iterator pass selector invoke Groovy mapper Mapping Script Java mapper Mapping Mapping method Mapping Selector Feature Mapping argument-type comparator condition expression greedy invoke path nop position type Comparators Geometric Angular clockwise counterclockwise Cartesian down-left down-right left-down left-up right-down right-up up-left up-right Dependency flow reverse-flow expression key label label-descending natural property property-descending EMF Ecore This section is a brief introduction to EMF Ecore, which is used to create metamodels of problem domains. These metamodels are then used as mapping targets. It is important to mention that metamodels and documentation generated from them have value on their own - they establish a common (ubiquitous) language.1 Eclipse Modeling Framework (EMF) is an Eclipse-based modeling framework and code generation facility for building tools and other applications based on a structured data model. Ecore is the core (meta-)model at the heart of EMF. It allows expressing other models by leveraging its constructs. Ecore is also its own metamodel (i.e.: Ecore is defined in terms of itself).2 Simply put, Ecore is a way to create (domain specific) languages understandable by both humans and computers. The above diagrams shows key Ecore concepts and their relationships. E prefix is dropped for clarity. E.g. EPackage is shown as Package. More detailed documentation can be found here - https://ecore.models.nasdanika.org/ (work in progress) Metamodel Module - Java/Maven module or an OSGi bundle. Contains zero or more models with each model containing a root package. Package - a group of classifiers and sub-packages. Packages are identified (keyed) by namespace URI&rsquo;s. Classifier - a class, data type or enumeration. Data type - a bridge to the Java type system. Enumeration - a collection of literals. Class - contains zero or more structural features - attributes and references and zero or more operations. May inherit from zero or more superclasses. Can be abstract and can be an interface. Structural feature - can hold single or multiple values Attribute - holds a &ldquo;simple&rdquo; value such as String, Date, number. Reference - relationship between two objects (EObjects). Unidirectional, but can be associated with another reference (opposite) to form a bi-directional relationship. References can be containment (composition) and non-containment (aggregation). Model Resource set - a group of related resources identified by a URI. Resource sets have associated packages, resource factories, adapter factories, and URI handlers. Resource - a group of objects. A resource is identified by a URI. Model Element - an instance of a metamodel class. Below is a concrete example using the Family metamodel and model: Metamodel Module - org.nasdanika.models.family:model Maven module, org.nasdanika.models.family Java module. Package - family defined in family.ecore resource with ecore://nasdanika.org/models/family namespace URI, several Java packages. Class - Man class inheriting from Person class. Structural feature Attribute - name attribute of Man (inherited from NamedElement). Reference Person.father - single non-containment reference, Person.children - many non-containment reference. Family.members - many containment reference. Model Resource set - created with a factory which treats .drawio diagram files as resources with diagram elements mapped to the family model. Resource - family.drawio file. Model Element - Paul and Elias are instances of Man class. Elias references Paul as his father. It is important to note that resources are identified by URI&rsquo;s, not URL&rsquo;s. It allows to load resources from multiple data sources - files, URL&rsquo;s, databases, source repositories such as Git, binary repositories such as Maven. Using Nasdanika classes it is also possible to load objects from multiple sources on access. For example, a person&rsquo;s id and name can be loaded from, say, Excel file or a database. Some other attributes may be loaded by making HTTP requests only if the client code reads those attributes. EMF Ecore provides facilities to read/write resources from/to XMI files and binary files. It also provides tools for creating models. Eclipse CDO allows to store models in distributed repositories. Nasdanika provides factories to load models from Drawio diagrams, MS Excel, Java sources, PDF files, and CSV files. It also provides URI handlers for loading models from classpath resources, GitLab &amp; Maven repositories. There is also a documentation generator for Ecore models. In addition to the family model mentioned above, you can find examples of Ecore models and generated documentation on this site. ContentProvider For the purposes of mapping the source structures are abstracted by the ContentProvider interface, whith the following methods: Collection&lt;? extends S&gt; getChildren(S element /*, Predicate&lt;S&gt; predicate */) - returns element children. URI getBaseURI(S element) - URI for resolving resources such as documentation. Object getProperty(S element, String property) - returns property used to perform mapping. Marked asMarked(S element) - for reporting locations of errors. S getConnectionSource(S element) - If the element is a connection/association - returns its source. Otherwise returns null. S getConnectionTarget(S element) - If the argument is a connection/association - returns its target. Otherwise returns null. String getName(S element) - Element name, e.g. Drawio element label text without HTML markup. String getDescription(S element) - Element description, e.g. Drawio element tooltip. Object getIdentity(S obj) - Object identity such as a unique ID or a URI. DrawioContentProvider DrawioContentProvider is an implementation of the ContentProvider for working with Drawio diagrams. It loads mapping properties from YAML in config property or a YAML resource specified in config-ref property. It also takes element and page links into account in parent/child relationships - linked elements are considered children of linking elements. DrawioContentProvider uses base-uri property for resolving the element base URI. If this property is not set, then the base URI is the URI of the drawio file plus a fragment, which is not significant for resolving relative URI&rsquo;s. If base-uri property is set, then it is resolved relative to the parent&rsquo;s base URI or the Drawio resource URI if there is no parent. Loading Drawio resources While you can use DrawioContentProvider directly and customize it to your needs, the primary usage scenario is to load Drawio diagrams as Ecore resources - mapping is performed behind the scenes: CapabilityLoader capabilityLoader = new CapabilityLoader();
ProgressMonitor progressMonitor = new PrintStreamProgressMonitor();
Requirement&lt;ResourceSetRequirement, ResourceSet&gt; requirement = ServiceCapabilityFactory.createRequirement(ResourceSet.class);		
ResourceSet resourceSet = capabilityLoader.loadOne(requirement, progressMonitor);
File diagramFile = new File(&quot;diagram.drawio&quot;).getCanonicalFile();
Resource resource = resourceSet.getResource(URI.createFileURI(diagramFile.getAbsolutePath()), true);		
EObject root = resource.getContents().get(0);	
 In the above code snippet a resource set is loaded from a CapabilityLoader and contains all resource factories and EPackages provided as capabilities. It includes ConfigurationLoadingDrawioResourceFactory which is registered to load .drawio and .png files. This factory customizes mapping properties: mapping - if this property is set, its value is parsed as YAML which is used as property source. mapping-ref - if mapping property is not set and this property is set, then this property value treated as a location of a YAML resource containing mapping configuration. The location (URI) is resolved relative to the base URI of the element. Phases &amp; properties Mapping is a non-trivial process. In the case of diagrams the order in which diagram elements are mapped is not under control of the user - it depends on the order of creation of the diagram elements. Therefore, the mapping process consists of several phases and some of them may involve multiple passes. This section describes the mapping process in the order of phases. A phase section explains element configuration properties (keys) used for that phase. In some phases only one property is used. In this case the phase name is the same as the property name. In the mapping reference pages properties are ordered alphabetically. Initialization In this first phase source elements are associated with (mapped to) target elements. For example, a person image can be associated with a person object from the family model. The phase is called &ldquo;Initialization&rdquo; because the mapping process is similar to assigning a value to a variable in languages like Java and virtually identical to what happens in JavaScript where objects are essentially maps. The following sections explain the configuration properties used in the initialization phase. initializer initializer property value shall be an Invocable URI resolved relative to the base URI. The invocable is bound to the following arguments by name: registry - Consumer&lt;BiConsumer&lt;Map&lt;EObject, EObject&gt;,ProgressMonitor&gt;&gt; callback to obtain a map of source elements to target elements once all target elements are initialized (created), but not necessarily fully configured. contentProvider - content provider progressMonitor - progress monitor resourceSet - can be used to load target model elements capabilityLoader - can be used to load capabilities, including invocable URIs Then it is invoked with the source object as a single positional argument. It may return null - in this case type would be used to create a target element, if specified. This property can be used, for example, to look-up target elements defined elsewhere. Say, a list of family members can be defined in an MS Excel workbook, but family relationships in a diagram. Another example is &ldquo;progressive enrichment&rdquo;. For example, high-level architecture is defined in some model and a diagram uses initializers for already defined architecture elements and type for their sub-elements. This approach can be applied multiple times similar to how Docker images are assembled from layers and base images - you can layer fine-grained models/diagrams over coarse-grained ones. If you are old enough to remember JPEG images being loaded over a slow dial-up connection - something like that. In order to implement lookup initializers, override configureInitializer(), configureInvocable() or getVariables() in sub-classes of AbstractMappingFactory or getVariables() in a subclass of ConfigurationLoadingDrawioResourceFactory. Groovy initializer Mapping initializer: initializer.groovy
 Script import org.nasdanika.models.architecture.ArchitectureFactory

ArchitectureFactory.eINSTANCE.createDomain();
 Java intitializer Mapping initializer: data:java/org.nasdanika.demos.diagrams.mapping.Services::nodeInitializer
 Initializer method public static ArchitectureDescriptionElement nodeInitializer(
		CapabilityFactory.Loader loader, 
		ProgressMonitor loadingProgressMonitor, 
		byte[] binding,
		String fragment,
		@Parameter(name = &quot;contentProvider&quot;) ContentProvider&lt;Element&gt; contentProvider,
		@Parameter(name = &quot;registry&quot;) Consumer&lt;BiConsumer&lt;Map&lt;EObject, EObject&gt;,ProgressMonitor&gt;&gt; registry,
		@Parameter(name = &quot;progressMonitor&quot;) ProgressMonitor mappingProgressMonitor,
		@Parameter(name = &quot;resourceSet&quot;) ResourceSet resourceSet,
		@Parameter(name = &quot;capabilityLoader&quot;) CapabilityLoader capabilityLoader,
		Element source) {
	ArchitectureDescriptionElement architectureDescriptionElement = ArchitectureFactory.eINSTANCE.createArchitectureDescriptionElement();
	architectureDescriptionElement.setDescription(&quot;I was created by a Java initializer&quot;);
	return architectureDescriptionElement;				
}
 Note the use of positional and named parameters: The first 4 parameters are bound positionally when invocable URI is loaded The 5 named parameters a bound by name by the mapper The last parameter is used for invocation (also positional) type type property is used if there is no initializer or if it returned null. The value of property is the type of the target element. Types are looked up in the factory packages in the following way: If the value contains a hash (#) then it is treated as a type URI. For example ecore://nasdanika.org/models/family#//Man. If the value contains a dot (.) then it is treated as a qualified EClass name with EPackage prefix before the dot. For example family.Man. There may be more than one dot if EClass is defined in a sub-package. For example, exec.content.Markdown. Otherwise, the value is treated as an unqualified EClass name - registered EPackages (and sub-packages recursively) are sorted by Namespace URI, iterated, and the first found EClass with matching name is used to create a target element. A combination of initializer and type can be used for mapping in different contexts. For example, when loading a stand-alone model initializer would evaluate to null and then type would be used. When the same diagram loaded in the context of a larger model, initializer may evaluate to a target element looked up in that larger model. Example: type: architecture.c4.System
 A Java analogy for type: Object isaDiagramElement = getClassLoader().loadClass(type).newInstance();
 ref-id ref-id is some identifier to resolve to a target element. If there is already a target element created/resolved with initializer or type and isRefIProxydURI() returns true, then ref-id is treated as EObject proxy URI resolved relative to the base URI (see below). You may need to use this approach in case of circular references between resources or if the target element type and URI are known, but the element itself is not available during the load time. If there is no target element yet, then ref-id is used to look it up in the resource set. You may use a &ldquo;physical&rdquo; URI to load objects on demand, or &ldquo;logical&rdquo;/&ldquo;semantic&rdquo; URI for already loaded objects. Say, ssn:123-45-6789 to lookup a person by their SSN. Contributor.initialize() Initialization can be customized by creating a service capability of type AbstractMappingFactory.Contriutor and overriding its initialize() method. page-element If there is no target element for a diagram element yet and the diagram element&rsquo;s page-element property is set to true then its target element is set to the first found target element of diagram elements linking to the page. For example, on the System Context Diagram the &ldquo;Internet Banking System&rdquo; element links to the Container diagram page where the &ldquo;Internet Banking System&rdquo; container is the page element. As a result, both of these diagram elements map to the same target element. There should be one page element per page. Having more than one may lead to an unpredictable behavior. Using page-element you can define a high-level structure on one diagram page, link other pages to the diagram elements and refine their definitions. This process can be repeated to build a hierarchy of pages as demonstrated in the &ldquo;Internet Banking System Architecture&rdquo; demo mentioned above. If the target element of a page element extends NamedElement then the page name is used as element&rsquo;s name if hasn&rsquo;t been already set by other means. prototype prototype is a Spring Expression Language (SpEL) expression evaluating to a diagram element. The target element of that diagram element is copied and the copy is used as the target element of this diagram element. Also, the prototype configuration (properties) is applied to this target element. Example: getPage().getDocument().getModelElementById('web-server-prototype') Prototypes allow to define common configuration in one element and then reuse it in other elements. For example, a web server prototype may define an icon and then all web server elements would inherit that configuration. Prototypes can be chained - you may create an inheritance hierarchy of diagram elements. Drawio classes provide convenience methods for finding diagram elements: Element.getModelElementById(String id) Element.getModelElementByProperty(String name, String value) Element.getModelElementsByProperty(String name, String value) Document.getPageById(String id) Document.getPageByName(String name) If you want to inherit just configuration, but not the target element, then use config-prototype property instead of prototype. selector selector is a Spring Expression Language (SpEL) expression evaluating to a diagram element. The target element of that diagram element is used as the target element of this diagram element. Selectors allow to use the same target element on multiple diagrams. For example, in the Internet Banking System E-Mail System is defined on the System Context Diagram and selected (referenced) on the Container Diagram with getModel().getPage().getDocument().getModelElementByProperty('semantic-id', 'microsoft-exchange') expression. The expression is evaluated in the context of the diagram element with access to the following variables: registry pass progressMonitor resourceSet capabilityLoader Please note that you may also use the extended link syntax to associate more than one diagram element with a single target element. If you are selecting by diagram element id or label, then the extended link syntax is preferable to using selector expression. In the &ldquo;Internet Banking System&rdquo; C4 Model demo Single-Page Application is defined on the Container Diagram and linked from the API Application Component Diagram with data:element/id,name,Container+Diagram/single-page-application) link. target-selector Spring Expression Language (SpEL) expression evaluating to a target element. Target selectors are similar to initializers with the following differences: Target selectors are evaluated after initializers An initializer is evaluated once, but a target selector might be evaluated multiple times until it returns a non-null value or the maximum number of passes is exceeded A target selector is only evaluated if there isn&rsquo;t a target element already Target selectors can be used to evaluate target elements using target elements of other elements. For example, a target selector of a child node may need a target element of its parent to resolve its own target element. The expression is evaluated in the context of the diagram element with access to the following variables: * registry * pass * progressMonitor * resourceSet * capabilityLoader reference Diagram elements can be associated with target elements&rsquo; references. A Java analogy would be: List&lt;Person&gt; isaChildrenDiagramElement = familyWorkBook.findById(&quot;isa&quot;).getChildren();
 reference property associates a diagram element with a reference of the target element of the first matched ancestor for mapping purposes. If the element has mapped descendants, their matching targets elements are added to the reference. Reference value can be a string or a map. The string form is equivalent to the map form with just the name entry. The map form supports the following keys: comparator - used to sort reference elements, see the Comparators section. condition - a SpEL boolean expression evaluated in the context of the ancestor target element. If not provided, matches the first mapped ancestor. Has access to the following variables: sourcePath - a list of ancestors starting with the parent registry expression - a SpEL EObject expression evaluated in the context of the ancestor target element. If not provided, the ancestor itself is used. Has access to the following variables: sourcePath - a list of ancestors starting with the parent registry name - reference name element-condition - a SpEL boolean expression evaluated in the context of the descendant (contents) target element. If not provided, elements are matched by type compatibility with the reference type. Has access to the following variables: sourcePath - source containment path registry element-expression - a SpEL EObject expression evaluated in the context of the descendant (contents) target element. If not provided, the descendant itself is used. Has access to the following variables: sourcePath - source containment path registry See References demo for examples of using reference mapping. features features property defines mapping of target element structural features - references and attributes. Feature mapping demo provides a few examples of reference mapping. The value of the property shall be a map with the following supported keys: end container contents self source start target end For connections - mapping specification, as explained in the Feature Mapping section, for the connection end feature to map the connection target semantic element3 to a feature of the connection semantic element. end: father
 The above specification means &ldquo;set father reference of the connection semantic element to the semantic element of its end (Joe)&rdquo;. container Mapping specification for the container element in container/contents permutation. Contains one or more of the following sub-keys with each containing a map of feature names to a mapping specification or a list of feature names. self - this element is a container other - the other element is a container Example type: family.Polity
features:
  container:
    self: 
      residents:
        argument-type: family.Person
        path: 1
    other: constituents
 The above example shows Texas feature mapping: self means Texas itself. The mapping specifies that immediate children of this element (path: 1) shall be added to this (Texas) semantic element residents collection if they are instances of family.Person. Joe diagram element is an immediate child of the Texas diagram element. other means USA because USA contains Texas. This mapping specifies that this (Texas&rsquo;) target element shall be added to the constituents feature of its container (USA) regardless of the containment path length. In the example the containment path length is 1. Please note that when a diagram element is linked to a page, then the page&rsquo;s page element is logically merged with that element. In the Internet Banking System Architecture GetBalanceRequest is contained by Internet Banking System with path=3 - they appear on different diagrams (pages), but these diagrams are connected with page links. contents Mapping specification for the contents element in container/contents permutation. Contains one or more of the following sub-keys with each containing a map of feature names to a mapping specification or a list of feature names. self - this element is contained by the other other - the other element is contained by this element Examples USA contents:
  other: 
    country:
      path: 2
 The above feature map for USA means that other is either Florida, Texas, Jane or Joe - they are all contained in USA directly or indirectly. Path 2 means that only Jane and Joe match this mapping. And country means that their country reference shall be set to USA. Joe contents:
  self: 
    country:
      path: 2
 The above feature map for Joe means that other is either Texas or USA - they both contain Joe, Texas directly and USA transitively. Path 2 means that only USA matches this mapping. And country means that Joe&rsquo;s country reference shall be set to USA. self A map of feature names to Spring Expression Language (SpEL) expressions or a list of expressions evaluating to the feature value or feature element value. The expression is evaluated in the context of the source diagram element and has access to the following variables: value - semantic element registry - a map of diagram element to semantic elements source For connections - mapping specification for the connection source feature to map the connection semantic element to a feature of the connection source semantic element. If there are no connection semantic elements, then the connection target semantic element is used instead (pass-through connection). source: father
 The above specification at the Jane -&gt; Joe connection means to set connection source (Jane) father feature to connection target semantic element (Joe) because the connection itself doesn&rsquo;t have semantic elements. In pseudo-code: connection.getSource().setFather(connection.getTarget());
 start For connections - mapping specification for the connection start feature to map the connection source semantic element to a feature of the connection semantic element. start: child
 The above specification means &ldquo;set child reference of the connection semantic element to the semantic element of its start (Jane)&rdquo;. target For connections - mapping specification for the connection target feature to map the connection semantic element to a feature of the connection target semantic element. If the connection doesn&rsquo;t have semantic elements (pass-through connection), then the connection source semantic element is used instead. target: children
 The above specification at the Jane -&gt; Joe connection means to set connection target (Joe) children feature to the connection source semantic element (Jane) because the connection itself doesn&rsquo;t have semantic elements. In pseudo-code: connection.getTarget().getChildren().add(connection.getSource());
 features-ref features-ref property value shall be a string which is treated as a URI resolved relative to the base URI. Resource at the URI is parsed as YAML. Representations For semantic elements which extend ModelElement the loading process injects representations which can be used in Markdown documentation and as icons in generated HTML documentation. The loading process injects two representations: drawio - a Drawio diagram containing pages where the page element maps to this target element. image - loaded from diagram element style image. Representation reduce documentation effort and drive consistency. Filtering Representations can be customized (filtered) by creating a service capability of type AbstractMappingFactory.Contributor implementing AbstractDrawioFactory.RepresentationElementFilter and implementing its filterRepresentation() method. This functionality can be used, for example to style elements based on information retrieved from external systems. For example: Development status - Planned/Backlog, In Progress, Blocked, Done Runtime status - Operational, Overloaded, Failed, Planned maintenance Quality/technical debt status - OK, Warning, Danger Configuration After diagram elements are mapped to target elements (initialized) and their features are mapped, they are configured using their diagram element properties as explained below. config-prototype With config-prototype property you can inherit configuration from another diagram element. Property value shall be a Spring Expression Language (SpEL) expression evaluating to a diagram element. Diagram element configuration (properties) is applied to this semantic element. Example: getDocument().getModelElementById('web-server-prototype') Config prototypes allow to define common configuration in one element and then reuse it in other elements. For example, a web server prototype may define an icon and then all web server element would inherit that configuration. Config prototypes can be chained - you may create an inheritance hierarchy of diagram elements. Documentation Documentation properties can be used to add documentation to target elements which implement Documented interface. Documentation can be provided in documentation property in Markdown, plain text, or HTML. Markdown is the default documentation format. You can modify it by setting doc-format property. Supported values are markdown, text, and html. It might be more convenient to maintain documentation in an external resource. In this case specify the documentation resource URI in doc-ref property. The resource URI is resolved relative to the base URI of the diagram element. If doc-format is not set, it is inferred from the resource extension - HTML for .htm and .html, text for .txt, Markdown otherwise. Documentation may also be configured via configuration or configuration-ref. Label If the target element extends NamedElement and its name is not set, then diagram element label converted to plain text is used as semantic element name. Markers If the target element implements Marked then the loading process adds diagram element markers to the semantic element. It allows to track provenance of data elements which might important in scenarios where model elements are loaded from diverse sources and even a single element may be loaded from several sources. For example, attributes are loaded from an Excel workbook and relationships from a Drawio diagram. The loading process is aware of Git repositories - if it detects that the diagram file is under source control it would store Git-specific information in markers - repository path, branch, commit hash, remotes, and head references. identity If the target element extends StringIdentity, identity property can be used to specify the id attribute. If this property is not provided, then Drawio model element ID is used as identity. Drawio element id&rsquo;s are editable, but duplicate id&rsquo;s are not allowed on the same page. You may have duplicate semantic id&rsquo;s in different containers on the same page. In this case you may use identity. Identity can also be set using the configuration and configuration-ref YAML, this property is a shortcut way. configuration Target elements may be configured by providing a YAML configuration map in the configuration property or a URI of a configuration resource in the configuration-ref property. The URI is resolved relative to the base URI of the diagram element. Configuration YAML maps target element features (attributes and references) to their values as shown in the below example: location: %id%/index.html
icon: /images/mapping.svg
children:
  - Action:
      location: mapping-reference.html
      text: Mapping Reference
      content:
        Interpolator:
          source:
            Markdown:
              style: true
              source:
                exec.content.Resource: mapping-reference.md
 Note singleton maps specifying child elements. The key of of such maps is a type as explained in the &ldquo;Initialization&rdquo; &gt; &ldquo;type&rdquo; section: Action - a short type name, there is only one Action class available during loading Interpolator - also a short type name exec.content.Resource - a fully qualified type name because there are two Resource classes - in the content package and in the resources package &ldquo;Load specification&rdquo; model documentation pages provide information about configuration keys supported by a specific type. Examples: Action class Load Specification Woman class Load Specification Tooltip If the target element extends NamedElement and its description is not set, then diagram element tooltip is used as semantic element description. Contributor.configure() Configuration can be customized by creating a service capability of type AbstractMappingFactory.Contributor and overriding its configure() method. Operations Using operations and operations-ref properties you may specify target element operations to be invoked. operations value shall be a YAML map of invocation target to operation names and then to invocation specifications explained below, operations-ref shall be a URI of a resource containing a YAML map. The URI is resolved relative to the diagram element base URI. The invocation target is either self, source or target`.sourceandtarget`` are applicable only to connections. The invocation specification is either a map or a list of maps. The sections below describe the keys supported by the maps. Examples: type: Fox
operations:
  self:
    eats: 
      arguments:
        food: &quot;#registry.get(outgoingConnections[0].target)&quot;
      pass: 2
 operations:
  source:
    eats: 
      arguments:
        food: &quot;#registry.get(target)&quot;
 arguments A map of parameter names to SpEL expression evaluating their values in the context of the iterator element (see below). Argument names are used for operation selection/matching - a candidate operation must have parameters with matching names. The map does not have to contain entries for all operation parameters. Nulls are used as arguments for parameters which are not present in the map. iterator An optional SpEL expression which returns a value to iterate over and invoke the operation for every element. If the result is java.util.Iterator then it is used AS-IS. If the result is Iterable, Stream, or array, an iterator is created to iterate over the elements. If the result is null, then an empty iterator is created. Otherwise, a singleton iterator is created wrapping the result. It allows to invoke the operation zero or more times. If not defined, the iterator contains the source diagram element. pass An optional integer specifying the pass in which this operation shall be invoked. Use for ordering operation invocations. In the above example, because we want the Fox to eat the Hare after the Hare eats the Grass, we need so set pass to 1 for the Fox. selector An optional SpEL boolean expression evaluated in the context of the operation to disambiguate overloaded operations. invoke The last phase of mapping is invoking Invocable URIs specified in invoke property. URIs are resolved relative to the base URI. Invocables are bound to the following arguments by name: target - target (semantic) element, can be null pass registry - a map of source elements to target elements contentProvider progressMonitor resourceSet capabilityLoader Then it is invoked with the source element as a single positional argument. If the invokable return false it means that it could not complete its job in this pass and it will in invoked again in subsequent passes until it returns anything other than false. This functionlity can be used for procedural/imperative mapping in configuration/declarative mapping is not enough or you just prefer to do things procedurally. Groovy mapper Mapping invoke: mapper.groovy
 Script import org.nasdanika.models.nature.Color

System.out.println(&quot;---&quot;);
System.out.println(&quot;Source: &quot; + args);
System.out.println(&quot;Target: &quot; + target);
System.out.println(&quot;Pass: &quot; + pass);

target.setColor(Color.BROWN);

return pass &gt; 2; // Just to test multiple invocations
 Java mapper Mapping invoke: data:java/org.nasdanika.demos.diagrams.mapping.Services::connectionMapper
 Mapping method 
public static void connectionMapper(
		CapabilityFactory.Loader loader, 
		ProgressMonitor loadingProgressMonitor, 
		byte[] binding,
		String fragment,
		@Parameter(name = &quot;target&quot;) Object target,
		@Parameter(name = &quot;pass&quot;) int pass,
		@Parameter(name = &quot;contentProvider&quot;) ContentProvider&lt;Element&gt; contentProvider,
		@Parameter(name = &quot;registry&quot;) Map&lt;EObject, EObject&gt; registry,
		@Parameter(name = &quot;progressMonitor&quot;) ProgressMonitor mappingProgressMonitor,
		@Parameter(name = &quot;resourceSet&quot;) ResourceSet resourceSet,
		@Parameter(name = &quot;capabilityLoader&quot;) CapabilityLoader capabilityLoader,
		Connection source) {

	System.out.println(&quot;--- Java mapper ---&quot;);				
	System.out.println(&quot;Connection: &quot; + source);		
	System.out.println(&quot;Pass: &quot; + pass);		
}	
 Note the use of positional and named parameters: The first 4 parameters are bound positionally when invocable URI is loaded The 5 named parameters a bound by name by the mapper The last parameter is used for invocation (also positional) Mapping Selector Mapping selector can be used to select zero or more target elements for feature mapping. If it is not provided, then the diagram element&rsquo;s target element is used for feature mapping, if it is present. Mapping selector shall be a YAML document containing either a single string or a list of strings. The strings are treated as Spring Expression Language (SpEL)] expression evaluating to a target element or a collection of target elements to use for feature mapping. Expressions are evaluated in the context of the diagram element and have access to the following variables: registry progressMonitor resourceSet capabilityLoader Mapping selectors may be used to associate multiple semantic elements with a diagram element for feature mapping purposes. Mapping selector can be defined in mapping-selector property or in an external resource with URI specified in mapping-selector-ref property. The resource URI is resolved relative to the base URI of the diagram element. Feature Mapping This section explains the structure of feature map values. The mapping value can be either a string or a map. If it is a string it is treated as a singleton map to true (unconditional mapping). The below two snippets are equivalent: container:
  other: elements
 container:
  other: 
    elements: true
 The map value supports the following keys: argument-type Specifies the type of feature elements to be set/added. String or a list of strings. Each string is a type name as defined above Optionally prefixed with ! for negation. In the case of a list of strings the result is a logical OR - if any of elements matches. Only instances of matching types will be set/added. If absent, the feature type is used. Argument type can be used to restrict elements to a specific subtype of the feature type. Examples: In the below snippet elements of type Transition and its sub-types are excluded from the elements. container:
  self: 
    elements:
      argument-type: &quot;!Transition&quot;
      path: 2
 In this example only elements of type Person (and its sub-types) are added to the members feature. container:
  self: 
    members:
    argument-type: Person
 This example is equivalent to the previous one, but lists Person sub-types Man and Woman explicitly. container:
  self: 
    members:
    argument-type:
      - Man
      - Woman
 comparator Comparator is used for sorting elements of &ldquo;many&rdquo; features. See the Comparators section below for a list of available comparators and their configurations. condition A SpEL boolean expression evaluated in the context of the candidate diagram element with the following variables: value - semantic element of the candidate diagram element path - containment path registry - a map of diagram element to semantic elements progressMonitor resourceSet capabilityLoader expression A SpEL expression evaluating to a feature value in the context of the diagram element with with the following variables: value - semantic element of the diagram element path - containment path registry - a map of diagram element to semantic elements progressMonitor resourceSet capabilityLoader greedy Greedy is used with containment features and specifies what to do if a candidate object is already contained by another object: no-children - grab the object if it is contained by an ancestor of this semantic element. This is the default behavior. false - do not grab true - always grab invoke Invocable URI resolved relative to the base URI. The invocable is bound to the following arguments by name: argumentValue - feature value or value evaluated by expression. baseURI context progressMonitor registry sourcePath type resourceSet capabilityLoader It is invoked with argument as positional argument and shall return feature value. path Either an integer number or a list of boolean SpEL expressions to match the path. If an integer, then it is used to match path length as shown in the example below, which matches only immediate children container:
  self: 
    elements:
      path: 1
 If a list, then it matches if the list size is equal to the path length and each element evaluates to true in the context of a given path element. Expressions have access to registry variable - a map of diagram elements to semantic (target) elements. nop If true then no mapping is performed and the chain mapper is not invoked. It can be used in scenarios with a default (chained) mapper to prevent the default behavior. position A number specifying the position of the element in the feature collection. Please note that while this key is supported using it may lead to loading errors if the feature collection is smaller than the position. Because the loading order is generally not controlled by the diagram author, only 0 position is guaranteed to work all the time. type Type of the feature object to match. String as defined in the Initialization / type section. Can be used in other mappings. Comparators Comparators are used for &ldquo;many&rdquo; features to order elements. A comparator instance is created by AbstractDrawioFactory.createMapperComparator() method which can be overridden in subclasses to provide support for additional comparators. The following comparators are provided &ldquo;out of the box&rdquo;: Geometric Diagram element position convey semantics. However, most diagramming tools ignore it. I.e. they lose information or force diagrammers to keep geometry and semantics in sync. Geometric comparators allow to order semantic elements according to the positions of their diagram elements - to semantize geometry. There are two classes of geometric comparators - Angular and Cartesian. Angular Angular comparators use angles to order elements. There are two flavors - clockwise and counterclockwise. clockwise Compares elements by their angle relative to the node of the semantic element which holds the many reference. For example, in the Living Beings demo &ldquo;Bird&rdquo;, &ldquo;Fish&rdquo;, and &ldquo;Bacteria&rdquo; are compared by their angle to the &ldquo;Living Beings&rdquo; with the angle counted from &ldquo;12 o&rsquo;clock&rdquo; - 90 degrees (default). Feature mapping with comparators of &ldquo;Bird&rdquo;, &ldquo;Fish&rdquo;, and &ldquo;Bacteria&rdquo; are defined at the connections from &ldquo;Living Beings&rdquo; as: source: 
elements:
 comparator: clockwise
 To specify the base angle other than 90 degree use the map version of comparator definition where clockwise is the key mapping to a number or string value. The number value is used as the angle value in degrees. The string value is treated as a Spring Expression Language (SpEL) expression evaluated in the context of the &ldquo;parent&rdquo; node. The expression may evaluate to a number or to a node. In the latter case the result is used to compute the angle between the context node and the result node. In the Living Beings example &ldquo;Streptococcus&rdquo;, &hellip;, &ldquo;Staphyllococcus&rdquo; are compared relative to the &ldquo;Bacteria&rdquo; node with the base angle being the angle between the &ldquo;Bacteria&rdquo; node and &ldquo;Living Beings&rdquo; node. As such, &ldquo;Streptococcus&rdquo; is the smallest node and &ldquo;Staphyllococcus&rdquo; is the largest. With the default angle of 90 degrees &ldquo;Lactobacyllus&rdquo; would be the smallest and &ldquo;Streptococcus&rdquo; would be the largest. Feature mapping with comparators of &ldquo;Streptococcus&rdquo;, &hellip;, &ldquo;Staphyllococcus&rdquo; is defined at connections from &ldquo;Bacteria&rdquo; to the respective genus nodes as: source: 
elements:
 comparator: 
clockwise: incoming[0].source
 incoming[0] evaluates to the connection from &ldquo;Living Beings&rdquo; to &ldquo;Bacteria&rdquo; and source evaluates to &ldquo;Living Beings&rdquo;. counterclockwise Reverse of clockwise. Cartesian Cartesian comparators use horizontal and vertical positions to compare/order elements with 2 coordinates and 2 directions in each it gives us 8 permutations. down-left Compares nodes by their vertical order first with higher nodes being smaller and then by horizontal order with nodes on the right being smaller. Nodes are considered vertically equal if they vertically overlap. down-right Compares nodes by their vertical order first with higher nodes being smaller and then by horizontal order with nodes on the left being smaller. Nodes are considered vertically equal if they vertically overlap. This comparator can be used for org. charts. left-down Compares nodes by their horizontal order first with nodes on the right being smaller and then by vertical order with higher nodes being smaller. Nodes are considered horizontally equal if they horizontally overlap. left-up Compares nodes by their horizontal order first with nodes on the right being smaller and then by vertical order with lower nodes being smaller. Nodes are considered horizontally equal if they horizontally overlap. right-down Compares nodes by their horizontal order first with nodes on the left being smaller and then by vertical order with higher nodes being smaller. Nodes are considered horizontally equal if they horizontally overlap. right-up Compares nodes by their horizontal order first with nodes on the left being smaller and then by vertical order with lower nodes being smaller. Nodes are considered horizontally equal if they horizontally overlap. up-left Compares nodes by their vertical order first with lower nodes being smaller and then by horizontal order with nodes on the right being smaller. Nodes are considered vertically equal if they vertically overlap. up-right Compares nodes by their vertical order first with lower nodes being smaller and then by horizontal order with nodes on the left being smaller. Nodes are considered vertically equal if they vertically overlap. Dependency flow and reverse-flow order elements based on how they are connected to each other. flow If one element is reachable from the other by traversing connections, then the reachable element is larger than the source element. In case of circular references the element with the smaller number of traversals to the other element is considered smaller. If elements are not connected they are compared by the fall-back comparator. Flow comparator can be used for workflows and PERT charts. If this comparator&rsquo;s value is a String, then it is used as a name of the fallback comparator. In the below example children in the Sample Family will be smaller than their parents and siblings will be compared using labels. container:
 self: 
members:
 argument-type: Person
 comparator: 
flow: label
 If the value is a map, then it may have the following keys: condition - A boolean SpEL expression evaluated in the context of a connection being traversed. It may be used to traverse only connections which match the condition. fallback - Fallback comparator. The below snippet shows the Internet Banking System Container diagram comparator: container:
 self: 
elements:
 path: 1
 comparator: 
flow: 
fallback: label
 condition: id != 'send-email'
 The condition specifies that a connection with sent-mail ID shall not be traversed. reverse-flow Same as flow but with target nodes being smaller than source nodes. expression A SpEL expression evaluated in the context of the feature element with other variable referencing the element to compare with. The expression has access to the following variables: registry progressMonitor resourceSet capabilityLoader key A SpEL expression evaluated in the context of the feature element. The expression must return a value which would be used for comparison using the natural comparator. label Uses the diagram element label converted to plain text as a sorting key. In the Family mapping demo family members are sorted by label using the following feature map definition: container:
 self: 
members:
 argument-type: Person
 comparator: label
 label-descending Uses the diagram element label converted to plain text as a sorting key to compare in reverse alphabetical order. natural Uses the feature element&rsquo;s compareTo() method for comparable elements. Otherwise compares using the hash code. Nulls are greater than non-nulls. property Uses diagram element property as a sorting key. A singleton map. For example: property: label
 property-descending The same as property, but compares in reverse alphabetical order. https://martinfowler.com/bliki/UbiquitousLanguage.html ↩ https://en.wikipedia.org/wiki/Eclipse_Modeling_Framework ↩ Here and below the term &ldquo;semantic element&rdquo; is used interchangeably with the term &ldquo;target element&rdquo; to avoid confusion with connection target element. ↩ Module Package Classifier Class Data type Enum Structural Feature Attribute Reference * * * Literal * * Operation * Parameter * * Metamodel Resource Set Resource Model Element * * Resource Factory URI Handler Adapter Factory Model registry Page-1

ai/ai-core/index.html.content:
This module provides AI interfaces implemented by provider modules such as OpenAI and Ollama. It also provides classes and interfaces for building similarity search and RAG solutions. Sources Javadoc See test sources for examples of using Nasdanika AI classes. Embeddings Generating Synchronous With telemetry All providers and models A specific provider Asynchronous With telemetry Chunking Embeddings resource Similarity search Chat With telemetery Retrieval-augmented generation (RAG) Embeddings Embeddings interface allows to generate one or more vectors per string. This follows the structure of Ollama REST API. This approach allows transparent chunking, which is provided by ChunkingEmbeddings class and its subclasses, EncodingChunkingEmbeddings in particular. Generating Synchronous CapabilityLoader capabilityLoader = new CapabilityLoader();
ProgressMonitor progressMonitor = new PrintStreamProgressMonitor();
try {
    Requirement&lt;Void, org.nasdanika.ai.Embeddings&gt; requirement = ServiceCapabilityFactory.createRequirement(org.nasdanika.ai.Embeddings.class);         
    org.nasdanika.ai.Embeddings embeddings = capabilityLoader.loadOne(requirement, progressMonitor);

    for(List&lt;Float&gt; vector: embeddings.generate(&quot;Hello world!&quot;)) {
        System.out.println(vector.size());
    }
} finally {
    capabilityLoader.close(progressMonitor);
}
 With telemetry All providers and models CapabilityLoader capabilityLoader = new CapabilityLoader();
ProgressMonitor progressMonitor = new PrintStreamProgressMonitor();             
try {
    OpenTelemetry openTelemetry = capabilityLoader.loadOne(ServiceCapabilityFactory.createRequirement(OpenTelemetry.class), progressMonitor);
    assertNotNull(openTelemetry);           

    Requirement&lt;Embeddings.Requirement, Embeddings&gt; requirement = ServiceCapabilityFactory.createRequirement(Embeddings.class);         
    Iterable&lt;CapabilityProvider&lt;Embeddings&gt;&gt; embeddingsProviders = capabilityLoader.load(requirement, progressMonitor);
    List&lt;Embeddings&gt; allEmbeddings = new ArrayList&lt;&gt;();
    embeddingsProviders.forEach(ep -&gt; ep.getPublisher().subscribe(allEmbeddings::add));
    for (Embeddings embeddings: allEmbeddings) {                
        assertNotNull(embeddings);
        System.out.println(&quot;=== Embeddings ===&quot;);
        System.out.println(&quot;Name:\t&quot; + embeddings.getName());
        System.out.println(&quot;Provider:\t&quot; + embeddings.getProvider());
        System.out.println(&quot;Max input:\t&quot; + embeddings.getMaxInputTokens());
        System.out.println(&quot;Dimensions:\t&quot; + embeddings.getDimensions());

        Tracer tracer = openTelemetry.getTracer(&quot;test.ai&quot;);        
        Span span = tracer
            .spanBuilder(&quot;Embeddings&quot;)
            .startSpan();

        try (Scope scope = span.makeCurrent()) {
            Thread.sleep(200);
            for (Entry&lt;String, List&lt;List&lt;Float&gt;&gt;&gt; vectors: embeddings.generate(List.of(&quot;Hello world!&quot;, &quot;Hello universe!&quot;)).entrySet()) {        
                System.out.println(&quot;\t&quot; + vectors.getKey());
                for (List&lt;Float&gt; vector: vectors.getValue()) {
                    System.out.println(&quot;\t\t&quot; + vector.size());
                }
            }
        } finally {
            span.end();
        }
    }
} finally {
    capabilityLoader.close(progressMonitor);
}
 A specific provider CapabilityLoader capabilityLoader = new CapabilityLoader();
ProgressMonitor progressMonitor = new PrintStreamProgressMonitor();             
try {
    OpenTelemetry openTelemetry = capabilityLoader.loadOne(ServiceCapabilityFactory.createRequirement(OpenTelemetry.class), progressMonitor);
    assertNotNull(openTelemetry);           

    Embeddings.Requirement eReq = new Embeddings.Requirement(&quot;Ollama&quot;, null, null, 0, 0);
    Requirement&lt;Embeddings.Requirement, Embeddings&gt; requirement = ServiceCapabilityFactory.createRequirement(Embeddings.class, null, eReq);         
