 Embeddings resource EmbeddingsResource provides content with pre-computed embeddings. It is modeled after McpSchema.Resource (see also MCP Resources) to make it easy to wrap an embedding resources into an MCP resource and vice versa. The idea is to publish text with embeddings and expose the data as an MCP resource and embeddings resource so it can be used by MCP clients, MCP tools, and there is no need to compute embeddings. Example: search-documents-embeddings.json contains plain text for the pages of this site with pre-computed Ada embeddings of page chunks. Similarity search SimilaritySearch interface is intended to be used for finding items similar to a query using one of find methods: List&lt;SearchResult&lt;D&gt;&gt; find(U query, int numberOfItems) Mono&lt;List&lt;SearchResult&lt;D&gt;&gt;&gt; findAsync(U query, int numberOfItems) Similarity search can work on any data type with a distance defined. The distance type must be Comparable. For example, for text distance can be computed using embeddings, a bag of words, a semantic graph, or a combination of thereof. Semantic graphs may be useful with internal terminology. Let&rsquo;s say there is a GBS system which uses IBM MQ for communication with payload structure defined as TVT and encoded to bytes using XLF. The semantic/knowledge graph would &ldquo;know&rdquo; that GBS stands for &ldquo;Global Booking System&rdquo; and it is related to TVT, MQ, and XLF1. An instance of similarity search can be adapted to another type using adapt(Function&lt;U,T&gt; mapper, Function&lt;U, Mono&lt;T&gt;&gt; asyncMapper) method. One usage scenario is to adapt a structured type to text by &ldquo;narrating&rdquo; it. For example, there is a Drawio diagram element or a C4 Model element, say API Application. In the case of a diagram element, it can be converted to text by explaining its label, tooltip, layer it belongs to, and other elements it connects to. The narration may also include styling such as color and geometry. E.g. &ldquo;above&rdquo;, &ldquo;to the right of&rdquo;. In the case of a model element the narration would include element documentation, its references, and its type. E.g.: The &ldquo;API Application&rdquo; is a Container. Paul is a Man. Static embeddingSearch() method adapts a float multi-vector search to string (text) search. There is a static method to adapt a single vector search to a multi-vector search. The below code snippet shows how to create a vector search instance on top of Hnswlib: HnswIndex&lt;IndexId, float[], EmbeddingsItem, Float&gt; hnswIndex = HnswIndex
    .newBuilder(1536, DistanceFunctions.FLOAT_COSINE_DISTANCE, resources.size())
    .withM(16)
    .withEf(200)
    .withEfConstruction(200)
    .build();

Map&lt;String, String&gt; contentMap = new HashMap&lt;&gt;();

resourceSet.getResources().subscribe(er -&gt; {
    List&lt;List&lt;Float&gt;&gt; vectors = er.getEmbeddings();
    for (int i = 0; i &lt; vectors.size(); ++i) {
        List&lt;Float&gt; vector = vectors.get(i);
        float[] fVector = new float[vector.size()];
        for (int j = 0; j &lt; fVector.length; ++j) {
            fVector[j] = vector.get(j);
        }
        hnswIndex.add(new EmbeddingsItem(
                new IndexId(er.getUri(), i), 
                fVector, 
                er.getDimensions()));               
    }
    contentMap.put(er.getUri(), er.getContent());
});

hnswIndex.save(new File(&quot;test-data/hnsw-index.bin&quot;));

SimilaritySearch&lt;List&lt;Float&gt;, Float&gt; vectorSearch = new SimilaritySearch&lt;List&lt;Float&gt;, Float&gt;() {

    @Override
    public Mono&lt;List&lt;SearchResult&lt;Float&gt;&gt;&gt; findAsync(List&lt;Float&gt; query, int numberOfItems) {
        return Mono.just(find(query, numberOfItems));
    }

    @Override
    public List&lt;SearchResult&lt;Float&gt;&gt; find(List&lt;Float&gt; query, int numberOfItems) {
        float[] fVector = new float[query.size()];
        for (int j = 0; j &lt; fVector.length; ++j) {
            fVector[j] = query.get(j);
        }
        List&lt;SearchResult&lt;Float&gt;&gt; ret = new ArrayList&lt;&gt;();
        for (com.github.jelmerk.hnswlib.core.SearchResult&lt;EmbeddingsItem, Float&gt; nearest: hnswIndex.findNearest(fVector, numberOfItems)) {
            ret.add(new SearchResult&lt;Float&gt;() {

                @Override
                public String getUri() {
                    return nearest.item().id().uri();
                }

                @Override
                public int getIndex() {
                    return nearest.item().id().index();
                }

                @Override
                public Float getDistance() {
                    return nearest.distance();
                }

            });
        }
        return ret;
    }

};      

 An instance of vector search can be adapted to a multi-vector search: SimilaritySearch&lt;List&lt;List&lt;Float&gt;&gt;, Float&gt; multiVectorSearch = SimilaritySearch.adapt(vectorSearch);
 and then to a text search: ChunkingEmbeddings&lt;?&gt; chunkingEmbeddings = new EncodingChunkingEmbeddings(
