}
 @Parameter annotation Parameter annotation can be used on method and constructor parameters to provide parameter name and optionally narrow parameter type. Script The below snippet exectutes test.groovy script in the current directory. ScriptEngineManger is used to get a ScriptEngine by extension. Therefore, the engine factory shall be registered with the script engine manager. CapabilityLoader capabilityLoader = new CapabilityLoader();
