System.out.println(result);
 The above snippet uses the below spec to create an instance of MyTestClass: {
	&quot;type&quot;: &quot;org.nasdanika.capability.tests.MyTestClass&quot;,
	&quot;bind&quot;: [
		&quot;data:value/String,Some+other+value&quot;
	]
}	
 Similar to data URL&rsquo;s a matching constructor is found for the following arguments: CapabilityFactory.Loader ProgressMonitor String - URL decoded URI fragment, may be null Bindings loaded from the bind array of URI&rsquo;s Below is the matching constructor: public MyTestClass(
		CapabilityFactory.Loader loader, 
		ProgressMonitor progressMonitor, 
		String fragment,
		String bind) {
	...;
}	
 YAML CapabilityLoader capabilityLoader = new CapabilityLoader();
