                &quot;&quot;&quot;;

            SyncToolSpecification syncToolSpecification = new McpServerFeatures.SyncToolSpecification(
                new Tool(&quot;calculator&quot;, &quot;Nasdanika calculator of all great things&quot;, schema), 
