 Client TelemetryMcpClientTransportFilter is a filter for McpClientTransport implementations adding telemetry. HttpClientTelemetrySseClientTransport propagates the trace to the server side. It can be used if the server supports telemetry, e.g. if it is built using Nasdanika MCP classes. OpenTelemetry openTelemetry = GlobalOpenTelemetry.get();
McpClientTransport transport = new HttpClientTelemetrySseClientTransport(
        &quot;http://localhost:8080&quot;, 
        openTelemetry.getTracer(TestMcp.class.getName() + &quot;.transport&quot;),
        openTelemetry.getPropagators().getTextMapPropagator(),
        null);

Tracer tracer = openTelemetry.getTracer(TestMcp.class.getName());       
Span span = TelemetryUtil.buildSpan(tracer.spanBuilder(&quot;testSseTelemetryClient&quot;)).startSpan();

try (Scope scope = span.makeCurrent()) {
    TelemetryMcpClientTransportFilter transportFilter = new TelemetryMcpClientTransportFilter(
            transport, 
            openTelemetry.getTracer(TestMcp.class.getName() + &quot;.transportFilter&quot;), 
            Context.current());         

    McpSyncClient client = McpClient.sync(transportFilter)
            .requestTimeout(Duration.ofSeconds(10))
            .capabilities(ClientCapabilities.builder()
                .roots(true)      // Enable roots capability
                .sampling()       // Enable sampling capability
                .build())
            .sampling(request -&gt; {                  
                CreateMessageResult result = null;
                return result;
            })
            .build();       

    client.initialize();
    ListResourcesResult resources = client.listResources();
    System.out.println(resources);

    ReadResourceResult resource = client.readResource(new ReadResourceRequest(&quot;nasdanika://drawio&quot;));           
    System.out.println(resource.contents());

    // List available tools
    ListToolsResult tools = client.listTools();
    System.out.println(tools);

    // Call a tool
    CallToolResult result = client.callTool(
        new CallToolRequest(&quot;calculator&quot;, 
            Map.of(&quot;operation&quot;, &quot;add&quot;, &quot;a&quot;, 2, &quot;b&quot;, 3))
    );
    System.out.println(result);         

    client.closeGracefully();
} finally {
    span.end();
}
 Please note that in the above example the current telemetry context is passed to the TelemetryMcpClientTransportFilter constructor. It is needed because the context does not propagate all the way along the reactive chain. You can find more examples of using the above classes to build telemetry-enabled MCP servers and clients in TestMcp class. Roadmap Annotations and a reflective capability factory Create annotations for prompts, resources and tools, infer sync/async from the return type. Description and tool schema is inline with expansion tokens to include content loaded from a URI, including classpath resources. Category and documentation for command documentation generation. Reflective factory using Reflector. If tools need capabilities, they shall be obtained during target construction/initialization - the reflector would deal just with creation of specifications.

