core/telemetry/index.html.content:
This module provides an instance of OpenTelemetry as a capability. The instance is obtained from GlobalOpenTelemetry. The capability factory takes care of installing a logback appender to bridge OpenTelemetry with logging frameworks. If you are new to OpenTelemetry, check out Open Telemetry Quick Reference (Java) for general information. This page focuses on Nasdanika-specific functionality. Configuration By default auto-configuration is disabled. Set otel.java.global-autoconfigure.enabled to true to enable auto-configuration. Then use Environment variables and system properties to configure the global instance. This is an example of Java command line properties to configure telemetry repoting to a collector over OTLP protocol: -Dotel.java.global-autoconfigure.enabled=true -Dotel.metrics.exporter=otlp -Dotel.logs.exporter=otlp -Dotel.traces.exporter=otlp -Dotel.exporter.otlp.endpoint=http://&lt;VM external IP&gt;:4317 -Dotel.service.name=&lt;service name&gt;. Logging Below is a sample logback.xml file/resource: &lt;?xml version=&quot;1.0&quot; encoding=&quot;UTF-8&quot;?&gt;
&lt;configuration&gt;
    &lt;appender name=&quot;file&quot; class=&quot;ch.qos.logback.core.FileAppender&quot;&gt;
        &lt;file&gt;nsd.log&lt;/file&gt;
        &lt;append&gt;true&lt;/append&gt;
        &lt;encoder&gt;
            &lt;pattern&gt;%d{HH:mm:ss.SSS} [%thread] %-5level %logger{36} - %msg %kvp{DOUBLE}%n&lt;/pattern&gt;
        &lt;/encoder&gt;
    &lt;/appender&gt;    
    &lt;appender name=&quot;OpenTelemetry&quot;
              class=&quot;io.opentelemetry.instrumentation.logback.appender.v1_0.OpenTelemetryAppender&quot;&gt;
        &lt;captureExperimentalAttributes&gt;true&lt;/captureExperimentalAttributes&gt;
        &lt;captureKeyValuePairAttributes&gt;true&lt;/captureKeyValuePairAttributes&gt;
    &lt;/appender&gt;
    &lt;root level=&quot;INFO&quot;&gt;
        &lt;appender-ref ref=&quot;file&quot;/&gt;
        &lt;appender-ref ref=&quot;OpenTelemetry&quot;/&gt;
    &lt;/root&gt;
&lt;/configuration&gt;
 Obtain a capability From a non-capability code ProgressMonitor progressMonitor = new PrintStreamProgressMonitor();
CapabilityLoader capabilityLoader = new CapabilityLoader();
try {
    Requirement&lt;Object, OpenTelemetry&gt; requirement = ServiceCapabilityFactory.createRequirement(OpenTelemetry.class);
    OpenTelemetry openTelemetry = capabilityLoader.loadOne(requirement, progressMonitor);

    ...

    } finally {
        parentSpan.end();
    }
} finally {             
    capabilityLoader.close(progressMonitor);
}
 See Capability for more details. From another capability provider If an instance of OpenTelemetry is required by another capability provider, use CapabilityFactory.Loader instead of CapabilityLoader and chain capability completion stages with thenApply and thenCombine(). thenApply() If your capability depends just on the OpenTelemetry capability then use thenApply() as shown below: public class MyCapabilityFactory extends ServiceCapabilityFactory&lt;MyRequirement, MyCapability&gt; {

    @Override
    public boolean isFor(Class&lt;?&gt; type, Object requirement) {
        return MyCapability.class == type &amp;&amp; (requirement == null || requirement instanceof MyRequirement);
    }

    @Override
    protected CompletionStage&lt;Iterable&lt;CapabilityProvider&lt;MyCapability&gt;&gt;&gt; createService(
            Class&lt;MyCapability&gt; serviceType, 
            MyRequirement requirement, 
            Loader loader,
            ProgressMonitor progressMonitor) {

        Requirement&lt;Object, OpenTelemetry&gt; openTelemetryRequirement = ServiceCapabilityFactory.createRequirement(OpenTelemetry.class);
        CompletionStage&lt;OpenTelemetry&gt; openTelemetryCS = loader.loadOne(openTelemetryRequirement, progressMonitor);      
        return wrapCompletionStage(openTelemetryCS.thenApply(openTelemetry -&gt; createMyCapability(openTelemetry, requirement)));
    }

    protected MyCapability createMyCapability(OpenTelemetry openTelemetry, MyRequirement requirement) {
        return new MyCapabilityImpl(openTelemetry, requirement);
    }

}
 thenCombine() If your capability depends on the OpenTelemetry capability and other capabilities, then use thenCombine() as shown below: public class MyCapabilityFactory extends ServiceCapabilityFactory&lt;Void, MyCapability&gt; {

    @Override
    public boolean isFor(Class&lt;?&gt; type, Object requirement) {
        return MyCapability.class == type &amp;&amp; requirement == null;
    }

    @Override
    protected CompletionStage&lt;Iterable&lt;CapabilityProvider&lt;MyCapability&gt;&gt;&gt; createService(
            Class&lt;MyCapability&gt; serviceType,
            Void serviceRequirement, 
            Loader loader, 
            ProgressMonitor progressMonitor) {


        Requirement&lt;Object, OpenTelemetry&gt; openTelemetryRequirement = ServiceCapabilityFactory.createRequirement(OpenTelemetry.class);
        CompletionStage&lt;OpenTelemetry&gt; openTelemetryCS = loader.loadOne(openTelemetryRequirement, progressMonitor);

        Requirement&lt;String, OpenAIClientBuilder&gt; openAIClientBuilderRequirement = ServiceCapabilityFactory.createRequirement(
                OpenAIClientBuilder.class,
                null,
                &quot;https://api.openai.com/v1/&quot;);

        CompletionStage&lt;OpenAIClientBuilder&gt; openAIClientBuilderCS = loader.loadOne(openAIClientBuilderRequirement, progressMonitor);

        return wrapCompletionStage(openAIClientBuilderCS.thenCombine(openTelemetryCS, this::createEmbeddings));
    }

    protected MyCapability createMyCapability(OpenAIClientBuilder openAIClientBuilder, OpenTelemetry openTelemetry) {
        return new MyCapabilityImpl(openAIClientBuilder, openTelemetry);
    }

}
