core/http/index.html.content:
Nasdanika Core HTTP module provides classes and interfaces for serving HTTP requests with Reactor Netty HTTP Server routes. Sources Javadoc Reflective routing Factories Serving Java http-server CLI command Capability factory module-info.java Graph/Diagram processors Processors Groovy Java Route (BiFunction) Route Builder (HttpServerRouteBuilder) Serving drawio http-server http-server Java Reflective routing ReflectiveHttpServerRouteBuilder uses Route and RouteBuilder annotations on methods, fields and types to build server routes. Example: package org.nasdanika.launcher.demo.http;

import org.nasdanika.http.ReflectiveHttpServerRouteBuilder.Route;
import org.reactivestreams.Publisher;

import reactor.core.publisher.Mono;
import reactor.netty.http.server.HttpServerRequest;
import reactor.netty.http.server.HttpServerResponse;

@Route(&quot;/test/&quot;)
public class DemoReflectiveHttpRoutes {

    /**
     * In this handler method GET is derived from the get prefix
     * and path is derived from Hello 
     */
    @Route
    public Publisher&lt;Void&gt; getHello(
            HttpServerRequest request, 
            HttpServerResponse response) {
        return response.sendString(Mono.just(&quot;getHello()&quot;));
    }

    /**
     * In this handler the HTTP method is GET because the 
     * first segment &quot;hola&quot; doesn't  match any HTTP method.
     * The path is &quot;hola/soy/dora&quot;
     */
    @Route
    public Publisher&lt;Void&gt; holaSoyDora(
            HttpServerRequest request, 
            HttpServerResponse response) {
        return response.sendString(Mono.just(&quot;holaSoyDora()&quot;));
    }

    /**
     * In this handler the path is explicitly specified
     * by the Route annotation 
     */
    @Route(&quot;do-something&quot;)
    public Publisher&lt;Void&gt; doSomething(
            HttpServerRequest request, 
            HttpServerResponse response) {
        return response.sendString(Mono.just(&quot;do someting&quot;));
    }

    @RouteBuilder(&quot;field-route-builder&quot;)
    public HttpServerRouteBuilder routeBuilder = routes -&gt; {
        routes.get(&quot;/hello&quot;, (request, response) -&gt; response.sendString(Mono.just(&quot;Hello from field route builder!&quot;)));             
    };

    @RouteBuilder(&quot;getter-route-builder&quot;)
    public HttpServerRouteBuilder getRouteBuilder() {
        return  routes -&gt; {
            routes.get(&quot;/hello&quot;, (request, response) -&gt; response.sendString(Mono.just(&quot;Hello from getter route builder!&quot;)));
        };
    };  

    @RouteBuilder(&quot;route-builder-method&quot;)
    public void buildRoutes(HttpServerRoutes routes) {
        routes.get(&quot;/hello&quot;, (request, response) -&gt; response.sendString(Mono.just(&quot;Hello from route builder method!&quot;)));
    };  

}
 The code snippet above shows three GET handler methods, a route builder field and two flavors of builder methods. All of their paths are prefixed with /test/ from the class level annotation. The code snippet below shows how to use the above handlers. Note that the handler target is registered with /reflective prefix. As such, the full path for, say, getHello() method, is /reflective/test/hello. ReflectiveHttpServerRouteBuilder builder = new ReflectiveHttpServerRouteBuilder();
builder.addTargets(&quot;/reflective&quot;, new DemoReflectiveHttpRoutes());

DisposableServer server = HttpServer
  .create()
  .port(8080)
  .route(builder::buildRoutes)
  .bindNow();

try (Terminal terminal = TerminalBuilder.builder().system(true).build()) {
 LineReader lineReader = LineReaderBuilder
   .builder()
            .terminal(terminal)
            .build();

 String prompt = &quot;http-server&gt;&quot;;
    while (true) {
        String line = null;
        line = lineReader.readLine(prompt);
        System.out.println(&quot;Got: &quot; + line);
        if (&quot;exit&quot;.equals(line)) {
         break;
        }
    }
}

server.dispose();
server.onDispose().block();
 Factories Route building can be organized into hierarchy using methods and fields annotated with Reflector.Factory or Reflector.Factories annotations. Such methods can also be annotated with Route - in this case route value is used as a prefix. Below snippets show two levels of factory hierarchy: import org.nasdanika.common.Reflector;
import org.nasdanika.http.ReflectiveHttpServerRouteBuilder.Route;

/**
 * Demo of a hierarchical routing with factory
 */
@Route(&quot;/super-factory&quot;)
public class ReflectorSuperFactory {

    @Route(&quot;/super-demo&quot;)
    @Reflector.Factory
    public ReflectorFactory getRoutes() {
        return new ReflectorFactory();
    }   

}
 import org.nasdanika.common.Reflector;
import org.nasdanika.http.ReflectiveHttpServerRouteBuilder.Route;

/**
 * Demo of a hierarchical routing with factory
 */
@Route(&quot;/factory&quot;)
public class ReflectorFactory {

    @Route(&quot;/demo&quot;)
    @Reflector.Factory
    public DemoReflectiveHttpRoutes getRoutes() {
        return new DemoReflectiveHttpRoutes();
    }   

}
 With factories you can assemble web applications from parameterizable building blocks. Serving Java ReflectiveHttpServerRouteBuilder builder = new ReflectiveHttpServerRouteBuilder();
builder.addTargets(&quot;/reflective&quot;, new DemoReflectiveHttpRoutes());

DisposableServer server = HttpServer
  .create()
  .port(8080)
  .route(builder::buildRoutes)
  .bindNow();

try (Terminal terminal = TerminalBuilder.builder().system(true).build()) {
 LineReader lineReader = LineReaderBuilder
   .builder()
            .terminal(terminal)
            .build();

 String prompt = &quot;http-server&gt;&quot;;
    while (true) {
        String line = null;
        line = lineReader.readLine(prompt);
        System.out.println(&quot;Got: &quot; + line);
        if (&quot;exit&quot;.equals(line)) {
         break;
        }
    }
}

server.dispose();
server.onDispose().block();
 http-server CLI command You can build a custom CLI and serve routes with http-server command by creating a capability factory and registering it in module-info.java. Capability factory public class DemoReflectiveHttpRoutesFactory extends ServiceCapabilityFactory&lt;Void, HttpServerRouteBuilder&gt; {

 @Override
 public boolean isFor(Class&lt;?&gt; type, Object requirement) {
  return HttpServerRouteBuilder.class == type &amp;&amp; requirement == null;
 }

 @Override
 protected CompletionStage&lt;Iterable&lt;CapabilityProvider&lt;HttpServerRouteBuilder&gt;&gt;&gt; createService(
   Class&lt;HttpServerRouteBuilder&gt; serviceType, 
   Void serviceRequirement, 
   Loader loader,
   ProgressMonitor progressMonitor) {

  ReflectiveHttpServerRouteBuilder builder = new ReflectiveHttpServerRouteBuilder();
  builder.addTargets(&quot;/reflective&quot;, new DemoReflectiveHttpRoutes());    
  return wrap(builder);
 }

}
